INSERT INTO `comics` VALUES (341, 72, '私密教学', 'https://www.syyym.net/yy/4611.html', 'https://img.ddmhjpg.top/kimi30/lifan/storage/cover/00a6bbe292e9979973a64c059e1f8004.jpg', '里番漫画', '完结', '私密教学13岁那年成为孤儿的子豪，被爸爸的朋友收养。然而成年后的子豪却对男女交往一无所知，阿姨与姐姐们决定给纯洁的子豪，来场教学……', '2025-11-18 03:10:04', '第261话 八方汇聚！', '2025-11-19 01:59:22', '2025-11-19 01:59:22', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (342, 73, '寄宿日记', 'https://www.syyym.net/yy/4193.html', 'https://img.ddmhjpg.top/kimi30/lifan/storage/cover/48eca4ffd276976592562b74063fb711.jpg', '里番漫画', '完结', '寄宿日记今年大一的俊宇因故寄宿在学校附近的朋友家中，某天深夜偶然看见朋友妈妈在房裡…「…是我眼花看错了吧?」', '2025-11-18 11:55:05', '第236话 千难万难，不负所望', '2025-11-19 01:59:25', '2025-11-19 01:59:25', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (343, 72, '物种起源', 'https://www.syyym.net/yy/2119.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/957241502bbe014b3338ee68098e908a.jpg', '', '完结', '物种起源白手起家的年轻财阀alpha受某企业高管的秘密委托，欲在即将在上海召开的秘密竞拍中拍下一个武器。但是因某人从中作梗导致竞拍取消，甚至任务也有可能会失败。对于诽谤者的唯一线索只有一个，就是在现场抓到的佣兵团自称是在神秘人物‘老师’的指示下参与了这个任务的黑客李永振，面对想要处置自己的胜贤，提出了一个交易。用武器的线索换取同伴们的安全，并做为担保拍摄‘xx录像’。虽然有些愚蠢但却莫名有些性感的年轻omega的荒唐提议，让胜贤开始一点一点对永振产生了兴趣...', '2025-11-16 05:35:04', '第246话师徒二人不得不说的故事', '2025-11-19 01:59:26', '2025-11-19 01:59:26', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (344, 74, '寄宿', 'https://www.syyym.net/yy/3061.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/4a53099b4db550b28a29b086d61837f2.jpg', '寄宿', '连载', '寄宿今年大一的俊宇与爸妈怄气，因此寄宿在学校附近的朋友家中。朋友家里还有一个单身母亲和两个女儿...因为一次意外，一种别样的气氛在家里荡漾开来。...', '2025-11-16 06:40:04', '第295话文化的力量', '2025-11-19 01:59:28', '2025-11-19 01:59:28', 1, 0, 0, 0, 0, 0);
INSERT INTO `comics` VALUES (345, 72, '健身教练', 'https://www.syyym.net/yy/4632.html', 'https://img.ddmhjpg.top/kimi30/lifan/storage/cover/24f5c86c75271c70a879fc1dc47065dd.jpg', '里番漫画', '连载', '健身教练贤秀是业绩万年垫底的健身教练，而组长杰森凭着销售能力和亲密的肢体接触常年独占业绩第一名的宝座。当青梅竹马来到健身房运动时，贤秀要怎么阻止她遭受到杰森的毒手呢？', '2025-11-01 09:30:05', '第265话 海州老大张万军', '2025-11-19 01:59:31', '2025-11-19 01:59:31', 1, 0, 0, 0, 0, 0);
