INSERT INTO `comics` VALUES (348, 74, '女儿闺蜜都归ME', 'https://www.syyym.net/yy/3042.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/30868eb0f1100ff18d9963dea6b0a6b5.jpg', '女儿闺蜜都归ME', '连载', '女儿闺蜜都归ME年轻时曾是偶像歌手，现在是制作人的世勋，偶然看到女儿的社群软体，被一位长得跟自己理想型相似的少女吸引目光......', '2025-11-18 05:10:01', '第228话打劫二人组', '2025-11-19 01:59:36', '2025-11-19 01:59:36', 1, 0, 0, 0, 0, 0);
