INSERT INTO `comics` VALUES (350, 72, '魔咒', 'https://www.syyym.net/yy/11004.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/3744b997cb889ae3dd6f8660d5e071fe.jpg', '', '完结', '魔咒综合格斗轻重量级冠军,‘周在京’虽然被写作无败神话,但其实有一个他人都不知道的魔咒.那就是在比赛前一天必须要有一次满意的sex才能获得胜利!在京想要通过物理治疗师‘金谈’解决了这个魔咒…', '2025-11-15 15:10:05', '第135话毛利，扶我起来', '2025-11-19 01:59:40', '2025-11-19 01:59:40', 1, 0, 0, 0, 0, 0);
