INSERT INTO `comics` VALUES (358, 72, '我被最想拥抱的男人威胁了', 'https://www.syyym.net/yy/2947.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/2776bcc00ea2c4836bd121ce0f8d175d.jpg', '耽美', '完结', '我被最想拥抱的男人威胁了要把你变得一辈子都离不开我才行。一直蝉联【最想被拥抱的男人第一名】5年的西条高人终于把位置让给了别人。抢走这个位置的人是仅仅出道3年的新人演员东谷准太...！对于高人的敌意，东谷准太却以微笑来面对警戒心max的高人醉酒后向东谷露出的丑态让两人位置对调！被抓住弱点的代价就是【请让我抱您】竟然要抱身为最想被拥抱的男人第一名的我？你家伙在说什么！', '2025-11-11 11:20:04', '第110话天帝的秘密！', '2025-11-19 01:59:53', '2025-11-19 01:59:53', 1, 0, 0, 0, 0, 0);
