INSERT INTO `comics` VALUES (365, 72, '甜蜜陷阱', 'https://www.syyym.net/yy/10361.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/e0566e719ecdc99c8b088fd439a5f0c7.jpg', '', '连载', '甜蜜陷阱夏攻在一家普通的公司过着平凡的职场生活某天后辈小云进公司之后就开始一直追在他身后.即使已经确认了对方的心意,但不知道为何小云却总是躲着夏攻的肢体接触.最终夏攻找到了小云的家,却看到他与一个陌生男子情意浓浓的样子.夏攻想起了这段时间一直躲着自己接触的小云并感受了一股剧烈的背叛感…', '2025-11-17 23:30:04', '第94话你确定要跟我打？(一更)', '2025-11-19 02:00:11', '2025-11-19 02:00:11', 1, 0, 0, 0, 0, 0);
