INSERT INTO `comics` VALUES (377, 76, '往日之花', 'https://www.syyym.net/yy/1389.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/2549ea9d05ef7729ef178585ad810d6e.jpg', 'MIANX', '完结', '往日之花看到母亲相册里的一位帅哥后，他就一直在做相关的梦。直到某天，当他睁开眼时，发现自己回到30年前，遇见了照片里的那个人...', '2025-11-19 01:55:03', '第132章：说大话目标，阴谋的心脏！', '2025-11-19 02:00:36', '2025-11-19 02:00:36', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (378, 73, 'Help Me(完结)', 'https://www.syyym.net/yy/2196.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/5fb2a6481691f1cfffd614494b68d7b3.jpg', '', '完结', 'Help Me(完结)旧源是个对男生没有任何兴趣的直男，而洪允则是个混迹于gay吧的疯子。可怜的旧源并非本意地刺激到了洪允的好奇心，并被洪允缠得脱不开身。哪怕旧源绞尽脑汁想避开这个臭名昭著的疯子，但洪允的一句话却让他乖乖上了床。‘旧源？就你这根牙签还想救援谁？救救你自己吧！’《完美的搭档》作者的短篇新作~', '2025-11-19 01:55:01', '第90话进来领死！', '2025-11-19 02:00:37', '2025-11-19 02:00:37', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (379, 79, '忘年之亲密关系', 'https://www.syyym.net/yy/14895.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/bb58293cbeb2c44d6eb2df4be0a54ee6.jpg', '', '连载', '忘年之亲密关系因为‘泰宪’的黑帮检举活动的成功而陷入危机的‘志泰’因为自己的收入来源和搭档都因为检察官的干涉出现了问题于是剩下自己的志泰产生了要折磨泰宪的报复心,寄了数不清的性骚扰的信.最终因为干扰到了工作而生气的泰宪确认了写信的人是谁…写信的居然是高中同学‘李志泰’?!', '2025-11-19 01:50:04', '第99话会员才能吃', '2025-11-19 02:00:40', '2025-11-19 02:00:40', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (380, 76, '老公每晚都不同', 'https://www.syyym.net/yy/14793.html', 'https://img.ddmhjpg.top//kimi30/coolomh/storage/cover/11f645f0f533e55d648a24bdcdd0b46e.jpg', '酷爱', '连载', '老公每晚都不同泰莉艾拉公主被卖给了有史以来最为臭名昭著的暴君里班佩尔皇帝做新娘。为了活下来，一定要被他拒绝才可以！泰莉艾拉做好了万全的准备，但是每晚总会有个长相帅气且身材姣好的男人出现在她的寝室？“我每晚都会来你的寝室找你。”什么？到底是为什么？为什么...您为什么这样，殿下？每天晚上都要做这种事吗？！', '2025-11-19 01:50:04', '第110话你又为中外文化交流立功了', '2025-11-19 02:00:42', '2025-11-19 02:00:42', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (381, 77, '明日抉择', 'https://www.syyym.net/yy/12871.html', 'https://img.ddmhjpg.top//fmgxinwys/storage/cover/7677c5389cccd8698ea446a1e622d2.jpg', 'BBLEM', '连载', '明日抉择绮罗因为长得像女孩，从小被妈妈当做女孩打扮，但他向往隔壁很有男子汉气概的隔壁哥哥们经常跟他们混，中学时发觉自己已经喜欢上了隔壁的阿健，但意外之却下得知阿健讨厌这类人...', '2025-11-19 01:50:04', '第122章：能否化解【第五更】马蹄掌要塞', '2025-11-19 02:00:44', '2025-11-19 02:00:44', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (382, 77, '熟悉的面孔', 'https://www.syyym.net/yy/11183.html', 'https://img.ddmhjpg.top//fmgxinwys/storage/cover/8b6b44ccdc912078d79a191e6f1fdea2.jpg', 'Oimaen', '连载', '熟悉的面孔孙制宛作为当红的主持人，却患上了罕见了“人面失认症”，看到熟悉的人都认不出对方。而他偶然间与李镇相遇后，发现自己的症状消失了，从此他开始追寻李镇的脚步，试图查出原因...', '2025-11-19 01:50:04', '第136章：骂出来了【第七更】仙女大世界', '2025-11-19 02:00:47', '2025-11-19 02:00:47', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (383, 72, '愈合', 'https://www.syyym.net/yy/8744.html', 'https://img.ddmhjpg.top/kimi30/fmgxin/storage/cover/d7c23fa43e1d4ff5b9ab8eddbb113902.jpg', 'ECCA', '连载', '愈合李真言因为出柜的绯闻变成一个默默无名的小演员，但是新来的生活助理郑靖宇似乎并不在意这一点始终如一地对李真言温柔以待，渐渐地李真言把一颗心放在了郑靖宇身上。', '2025-11-19 01:50:04', '第119章对我微笑【完结】阴凉箐真的脱贫了', '2025-11-19 02:00:50', '2025-11-19 02:00:50', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (384, 72, '爱你情出于蓝', 'https://www.syyym.net/yy/7297.html', 'https://img.ddmhjpg.top/kimi30/fmgxin/storage/cover/bbb89abd235e41eab4887d636af5b4df.jpg', '阿柯文化', '连载', '爱你情出于蓝于蓝爱了盛又霆11年，自卑到了骨髓。当她爱不下去将他剔除后，才发现那一场剥离不仅仅是疼，还让她差点丢了性命。原来爱惯了一个人，若停了下来，不成疯便成魔。', '2025-11-19 01:50:04', '第81章交流会【第一更】重要的心里话科幻城墙！', '2025-11-19 02:00:52', '2025-11-19 02:00:52', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (385, 77, '浪漫箱子', 'https://www.syyym.net/yy/4428.html', 'https://img.ddmhjpg.top/kimi30/lifan/storage/cover/6c070c2a192163156fe95725489fce10.jpg', '里番漫画', '连载', '浪漫箱子公司职员圣灿从高中开始就单恋南允泰，同学聚会相见是生活唯一的期盼，交换了仿佛玩笑一样的圣诞节礼物，完成了每年可以收到他送的礼物的愿望，但是竟然发生了那种事！？', '2025-11-19 01:50:04', '第120话 最后的一击！', '2025-11-19 02:00:54', '2025-11-19 02:00:54', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (386, 72, '变奏', 'https://www.syyym.net/yy/4114.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/f71ac57313d479a5e05d988f647632a0.jpg', 'TCi', '完结', '变奏严幼元已经是个出道的歌手非常喜欢还未出道的申智安，在发现申智安快出道的时候利用手中的资源打击她令她只能依靠自己，之后被申智安发现后她决定要报复回来。', '2025-11-19 01:50:04', '第99章：补偿【完结】预案里可没这情况', '2025-11-19 02:00:56', '2025-11-19 02:00:56', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (387, 72, '内或外', 'https://www.syyym.net/yy/3583.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/29fa985920e0926d25203accac326fa3.jpg', 'AO', '连载', '内或外游戏软件公司职员安艺映作为代表至SJ集团参加游戏软件广告计划发表，在发表日当天状况百出。机缘巧合与SJ集团理事相识，有幸进入公司，有着才华与美貌并存的SJ集团理事发生了一些美好的事情。', '2025-11-19 01:50:04', '第244章：【第三季完结】话分崩离析7', '2025-11-19 02:00:57', '2025-11-19 02:00:57', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (388, 72, '赤狼', 'https://www.syyym.net/yy/1644.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/2a56179672e9e6e1267493cdda6d2c8a.jpg', 'RIan', '连载', '赤狼每到月圆之夜他就会变身为狼。因为一次意外，他的朋友发现了这个难以置信的秘密...', '2025-11-19 01:50:02', '第176章：【番外完结】兄弟酒，掏心话悲哀的天玺长老', '2025-11-19 02:01:00', '2025-11-19 02:01:00', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (389, 77, '无法拒绝', 'https://www.syyym.net/yy/13407.html', 'https://img.ddmhjpg.top//fmgxinwys/storage/cover/4a18e86eb3849f22e1436184f367ff.jpg', 'MINX', '完结', '无法拒绝因为基因实验造出的克隆人，无法拒绝宿主的命令。直到某天，他遇到了一位把他当成真正人类的人...', '2025-11-19 01:45:04', '第112章：怕真是要起风了', '2025-11-19 02:01:03', '2025-11-19 02:01:03', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (390, 77, '厄运巫师', 'https://www.syyym.net/yy/12441.html', 'https://img.ddmhjpg.top//fmgxinwys/storage/cover/ecdca94ac88b4ba8cd67f79e4bb909b.jpg', 'saxL', '连载', '厄运巫师佐本因为体质特殊，被收养的神社作为赚钱的工具，替富豪们阻挡厄运，但在遇见新野后，这个似曾相识的男人，让佐本第一次开始思考自己存在的意义……', '2025-11-19 01:45:04', '第113章：反派死于话这个队友有点顶', '2025-11-19 02:01:05', '2025-11-19 02:01:05', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (391, 80, '疯批殿下的虐爱', 'https://www.syyym.net/yy/9750.html', 'https://img.ddmhjpg.top//miandan/storage/cover/1645776591013.jpg', '疯批殿下的虐爱', '完结', '疯批殿下的虐爱浮游之命，苟活于世，本想了此残生寻母而去。却见到了无比耀眼的皇太子，为了逃离城主府，恳求留宿的太子收留为其效力，却被吃干抹净。一觉醒来，空无一人，人走茶凉了，原来还是被抛弃了啊……', '2025-11-19 01:45:04', '第78话满山野花盛开的年代', '2025-11-19 02:01:08', '2025-11-19 02:01:08', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (392, 72, '奇怪的两人', 'https://www.syyym.net/yy/8916.html', 'https://img.ddmhjpg.top/kimi30/fmgxin/storage/cover/0b85a61cd9bf4809a8f6d25cfb27f3d9.jpg', 'Cienma', '连载', '奇怪的两人次郎暗恋着邻居燕木，但自从他某次在网上看到燕木发的私房照被燕木发现后两人的关系逐渐变得有些微妙...', '2025-11-19 01:45:04', '第123章奇怪的人【完结】二妖威武！', '2025-11-19 02:01:10', '2025-11-19 02:01:10', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (393, 76, '星星兔', 'https://www.syyym.net/yy/8491.html', 'https://img.ddmhjpg.top/kimi30/fmgxin/storage/cover/a3045b43aace466f950dc7a180e99b38.jpg', 'SakanaTojo', '连载', '星星兔赛意与武拓是发小，两人相互喜欢对方，为了进一步增进感情想到了一起去旅行，过程中给别人发糖。', '2025-11-19 01:45:04', '第103章【番外】为了美色冲昏了头脑', '2025-11-19 02:01:12', '2025-11-19 02:01:12', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (394, 72, '须田君的秘密', 'https://www.syyym.net/yy/8461.html', 'https://img.ddmhjpg.top/kimi30/fmgxin/storage/cover/f22ee60be1a34fce8ea010c29ec1e2e1.jpg', 'Ioiem', '连载', '须田君的秘密森内偶然间救下陷入约会兼职中的须田并得知须田的爱好是女装，作为报答森内看了须田的女装状态，但之后森内却让须田穿着女装跟他约会...', '2025-11-19 01:45:04', '第115章在一起【完结】天阳神子！', '2025-11-19 02:01:15', '2025-11-19 02:01:15', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (395, 76, '直到遇见你', 'https://www.syyym.net/yy/8359.html', 'https://img.ddmhjpg.top/kimi30/fmgxin/storage/cover/02ef8cab1ac242348189efa1a07a34a4.jpg', 'Eozx', '完结', '直到遇见你韩泰俊某次注意到马东健告白失败后倔强的表情，对他感兴趣并对其表白，但之后马东健在大学课题组上发现韩泰俊似乎和告白那次的他有点不一样。', '2025-11-19 01:45:04', '第78章你要记住你说过的话惊天逆转！', '2025-11-19 02:01:18', '2025-11-19 02:01:18', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (396, 72, '传奇新人', 'https://www.syyym.net/yy/3695.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/03e5bdbe0a484ec8ef0f93926500d8cb.jpg', 'QK', '完结', '传奇新人一位高材生，来到一家广告公司，和上司一起，联手打造广告界的传说...', '2025-11-19 01:45:04', '第177章：【番外】四季楼，滚出去！', '2025-11-19 02:01:20', '2025-11-19 02:01:20', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (397, 81, '惊堂', 'https://www.syyym.net/yy/2767.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/16b3ad8895ef22e280f5f4fe963fc95a.jpg', '萍琪泡', '完结', '惊堂奈一是地府大理寺前一棵枫树。修成人身后成为地府历史上分数最高最年轻的判官。一时意气风发，天之骄子贵不可言。却昙花一现仕途情场皆失意。后以身祭天，本该成为奈何桥上无名小鬼，又阴差阳错重返世间。黑恶势力，贪官污吏，暗处强大的对手。死过一次，还有何惧。天不亡我，这一世定要将那浑水搅个天翻地覆。', '2025-11-19 01:45:04', '第109话副市长分工调整', '2025-11-19 02:01:23', '2025-11-19 02:01:23', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (398, 76, '投其所好', 'https://www.syyym.net/yy/6364.html', 'https://img.ddmhjpg.top/kimi30/lifan/storage/cover/d7c794f52059015e992a8a19ca7aff18.jpg', '里番漫画', '连载', '投其所好洙妍在健身房被韩渽民吸引，两人靠着相同的爱好很快走到一起。但是洙妍背地里却是一个喜欢...的宅女，这让韩渽民十分头疼...', '2025-11-19 01:45:02', '第80话 我确定，她回来了！', '2025-11-19 02:01:25', '2025-11-19 02:01:25', 0, 0, 0, 0, 1, 0);
INSERT INTO `comics` VALUES (399, 72, '别去按摩店', 'https://www.syyym.net/yy/15053.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/e4cfceacec813ce1ad35536be7f7d4f8.jpg', '', '连载', '别去按摩店作为救了部下一命的回报，头目姜哲得到了一张按摩店优惠券。为了缓解因长时间的战斗而紧张的身体，姜哲去了按摩店。让我换的衣服有点暴露啊…真的是让我穿这个吗？！', '2025-11-16 14:40:05', '第99话一个牢头的幸福生活', '2025-11-19 02:01:33', '2025-11-19 02:01:33', 0, 0, 1, 1, 0, 592649);
INSERT INTO `comics` VALUES (400, 82, '大公的秘密契约', 'https://www.syyym.net/yy/15052.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/b51e002f4faa24cd8f0b0f1b9224cfce.jpg', '', '完结', '大公的秘密契约被诅咒的北部大公每晚都被欲火折磨。偶然看到这个情景的魔法师提出愿意和大公签订秘密契约，那就是他帮大公排解，大公则为他提供研究材料…', '2025-11-14 07:40:04', '第98话故人，冷一刀', '2025-11-19 02:01:35', '2025-11-19 02:01:35', 0, 0, 1, 1, 0, 117997);
INSERT INTO `comics` VALUES (401, 83, '失重的爱情', 'https://www.syyym.net/yy/15051.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/5dc819daa1c912f60de77e714f5add1a.jpg', '', '完结', '失重的爱情为了还清父亲欠下的债款朴素翰一个人到处打工赚钱,过了6年终于还清所有欠款打算在新家开始新的生活.但是只开心了一会儿,一艘宇宙飞船就砸坏了他的房子.就在素翰喊着管他是不是外星人给我从家里滚出去的时候,他见到了从飞船下来的诗华...“你哭的样子,真的很难看.我会把你变得好看的,你继续哭吧没事的地球人?”房子被弄坏已经很伤心了,现在还要被外星人戏弄吗?', '2025-11-18 05:35:05', '第98话欺山莫欺水', '2025-11-19 02:01:37', '2025-11-19 02:01:37', 0, 0, 1, 1, 0, 55818);
INSERT INTO `comics` VALUES (402, 84, '哈尼熊', 'https://www.syyym.net/yy/15050.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/10a12bd69fcef67afbb1b62e71b29b7a.jpg', '', '完结', '哈尼熊文健宇，年龄21岁。拥有高大的身材和挺拔的身躯以及致命的凶器（？），却完全没有任何经验。唯一感兴趣的事就只有运动！有一天，带着黄油香的面包店老板刘河振出现在了健宇面前！单纯青年健宇被河振的香甜所倾倒，于是...！！', '2025-11-18 10:20:04', '第106话陆远收了对手钱了？', '2025-11-19 02:01:39', '2025-11-19 02:01:39', 0, 0, 1, 1, 0, 41278);
INSERT INTO `comics` VALUES (403, 74, '不良关系', 'https://www.syyym.net/yy/15049.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/e18262f054f9190d73deb7df3c97160f.jpg', '不良关系', '连载', '不良关系陈晟真在下宿居住时，遇见了他命中的女神-善美姐，两人渐渐发展成了秘密交往的关系。但是当善美外出留学归来，却突然宣布自己已经结婚，而更让陈晟真没想到的是，善美的老...', '2025-11-19 00:55:04', '第87话麻将传到仙界', '2025-11-19 02:01:42', '2025-11-19 02:01:42', 0, 0, 1, 1, 0, 152291);
INSERT INTO `comics` VALUES (404, 74, '大学俱乐部', 'https://www.syyym.net/yy/15048.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/966dca2f0ccaf35afb6b41e4e9038f4b.jpg', '大学俱乐部', '连载', '大学俱乐部宋建宇因为开学时生病，错过了和同学们亲近的机会，导致被孤立。就在他彷徨时，收到了热情的英语会话社团的邀请，成为了她们中的一员......', '2025-11-07 08:20:04', '第95话碑与剑的过往', '2025-11-19 02:01:45', '2025-11-19 02:01:45', 0, 0, 1, 1, 0, 42134);
INSERT INTO `comics` VALUES (405, 73, '沐浴阳光', 'https://www.syyym.net/yy/15047.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/b401e3507ed380e24fe184bf18c3f032.jpg', '', '完结', '沐浴阳光这是发生在一位17年撩人却不自知和一位独自暗恋友人7年的两人之间的故事.文书允逃跑了.放弃的钢琴,母亲的死亡,父亲的外遇.还有爱恋了7年的友人有了女友.“书允啊,我足足等了你两年,你就一点都不想我吗?”书允冒着随时都会被发现的危险以’朋友’的名义呆在了延载的身边.看着突然抱上来的他,书允想起了那天见到的他的女友,他还是默默整理好了自己的心意.但是突然有一天,书允还是被延载发现他喜欢的是男生.书允为了隐瞒自己的心意对延载说谎了.“允延载.我...不喜欢男生.', '2025-11-18 04:45:04', '第96话毕玄，来给大爷乐一个！', '2025-11-19 02:01:47', '2025-11-19 02:01:47', 0, 0, 1, 1, 0, 44990);
INSERT INTO `comics` VALUES (406, 85, '火花夢', 'https://www.syyym.net/yy/15046.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/638c00038093c326bb92323f29e47303.jpg', '', '完结', '火花夢第七世，才是血淋淋的复仇！帮助了陷入困境的巫女的柳熙谦，获得了五次生命。五次生命都无疾而终后，柳熙谦再度复活。又一次地重生之后，内心目标只剩下了对叛徒的报复。因为某种变数，第七世中的生活出现了与记忆不同的画面。“结婚了，不管是死是活，贵妃现在都已经是我的人了。”怎么就成了英王唯一的贵妃，开始受到宠爱了呢…“如果你敢逃跑，我就会把你的腿割下来放在内院。”这是莫名执着的英王陈赫伟，和第七世还执着于复仇的柳熙谦的故事。', '2025-11-16 10:00:04', '第107话金袍执事袁雷', '2025-11-19 02:01:55', '2025-11-19 02:01:55', 0, 0, 1, 1, 0, 32987);
INSERT INTO `comics` VALUES (407, 86, '我们的转世', 'https://www.syyym.net/yy/15045.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/dad93ef69f71e3c937929bb59ec1db6d.jpg', '', '完结', '我们的转世本来幸福的生活因为一场谋反瞬间灰飞烟灭.“如果再给我一次机会的话…”在离死之前的祈祷之后,时间来到了2023年.失去了一切只剩下一条命还有什么意义.但是今生依旧和过去有着密切联系.有过生死之交的挚友,厌恶至极的元凶…还有过去的爱人都在这个世界相聚了.只是…转世之后还是前世的性别吗?', '2025-11-16 19:40:05', '第91话疯狂的女人', '2025-11-19 02:01:57', '2025-11-19 02:01:57', 0, 0, 1, 1, 0, 24120);
INSERT INTO `comics` VALUES (408, 72, '双头绳索', 'https://www.syyym.net/yy/15044.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/5e7ebef17cc3623f9cc3c79f2dabfdea.jpg', '', '完结', '双头绳索机构内的最精锐的超能力者“瑞克”遇到了指导者“贝利”，但因为贝利的特别之处，瑞克非但没有想着靠近贝利，反而想方设法地避开他。两人真的能在一起吗？', '2025-11-15 15:50:02', '第89话算利息给你们', '2025-11-19 02:01:59', '2025-11-19 02:01:59', 0, 0, 1, 1, 0, 15431);
INSERT INTO `comics` VALUES (409, 74, '我的女主人', 'https://www.syyym.net/yy/15043.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/51036b50b8301238ae196993e2ebd17d.jpg', '我的女主人', '连载', '我的女主人俊培为了完成开跑车的梦想，跑到大老板手下当随行司机。在经历一场大风波之后，俊培意外地和老板的女儿发生了关系。此后，俊培甚至搬进了老板的豪宅内，开始伺候起行事神秘...', '2025-11-17 15:35:01', '第95话我的剑，你接得住？', '2025-11-19 02:02:01', '2025-11-19 02:02:01', 0, 0, 1, 1, 0, 39636);
INSERT INTO `comics` VALUES (410, 72, '大佬的社内恋爱', 'https://www.syyym.net/yy/15042.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/926c4ffc002800050c383458ce71aea2.jpg', '', '完结', '大佬的社内恋爱‘社内恋爱一旦被发现，即刻处死’因吉童派传闻中禁止社内恋爱的条款，表面上是对手的左膀黄龙浩和右臂具子延过着白天杀气冲天，晚上情意绵绵的日子。就这样谈了4年恋爱后的某一天，两个人收到了一张匿名纸条？！“我知道你们在交往。可是组织里又不是只有你们两个人！！”', '2025-11-18 06:15:04', '第104话每一个环节，都凶险无比', '2025-11-19 02:02:03', '2025-11-19 02:02:03', 0, 0, 1, 1, 0, 16772);
INSERT INTO `comics` VALUES (411, 73, '给哀悼的你', 'https://www.syyym.net/yy/15041.html', 'https://img.ddmhjpg.top/kblmh/storage/cover/3d28dcb074c0ce36022168c688d8983d.jpg', '', '完结', '给哀悼的你我’金道允’为了救一个小孩被车撞死了.然后再次醒来发现自己变成了大学后辈’芮道允’.一直过着平凡生活的金道允虽然想努力适应大公司会长私生子芮道允的生活但两个人之间的差异还是太大了.唯一的共通点只有同校同系的后辈’韩洁’.道允下定决心去接近韩洁却发现他跟记忆中那个温柔的人完全不一样.“我不管你是想从我这里拿到什么,还是只是想耍我我都不在乎…但你别想着用这种东西来利用道允哥.不然的话我会杀了你的.”', '2025-11-17 10:15:04', '第97话南京，再见！', '2025-11-19 02:02:06', '2025-11-19 02:02:06', 0, 0, 1, 1, 0, 18297);
